import React, { ReactElement } from 'react'
import {Button, Form, Input} from "antd";
import { SendOutlined, UserOutlined } from '@ant-design/icons';
import './LetterForm.css'
const { TextArea } = Input;

interface Props {

}

export default function LetterForm({ }: Props): ReactElement {
    const onFinish = (values: any) => {
        console.log('Success:', values);
    };

    return (
        <div>
            <Form
                className='form-container'
                name="basic"
                labelCol={{ span: 8 }}
                wrapperCol={{ span: 16 }}
                initialValues={{ remember: true }}
                onFinish={onFinish}
                onFinishFailed={onFinishFailed}
            >
                <Form.Item
                    label="user"
                    name="user"
                    rules={[{ required: true, message: 'Please input your user!' }]}
                >
                <label>보내는 사람</label>
                <Input placeholder="보내는 사람의 이름을 입력해주세요." prefix={<UserOutlined />} />
                </Form.Item>

                <Form.Item
                    label="title"
                    name="title"
                    rules={[{ required: true, message: 'Please input your title!' }]}
                >
                <label>제목</label>
                <Input placeholder="제목을 입력해주세요." allowClear  />
                <br />
                </Form.Item>

                <Form.Item
                    label="contents"
                    name="contents"
                    rules={[{ required: true, message: 'Please input your contents!' }]}
                >
                <label>내용</label>
                <TextArea placeholder="동영이한테 보낼 편지 내용을 입력해주세요." showCount maxLength={1999} allowClear  />
                </Form.Item>
                <br />
                <Form.Item wrapperCol={{ offset: 8, span: 16 }}>
                <Button icon={<SendOutlined />} type="primary" shape="round" htmlType="submit">
                    편지 보내기
                </Button>
                </Form.Item>
            </Form >
        </div>
    )
}
